import React from 'react';
import '../App';
import {Link} from 'react-router-dom';

export const Navbar =() =>{
    return ( <nav class="navbar navbar-expand-lg bg-body-tertiary">
  <div class="container-fluid">
    <a class="navbar-brand" href="#">Navbar</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNav">
      <ul class="navbar-nav">
        <li class="nav-item">
          <Link to ="/" class="nav-link active" aria-current="page" href="#">Home</Link>
        </li>
        <li class="nav-item">
          <Link to ="/" class="nav-link" >Credit</Link>
        </li>
        <li class="nav-item">
          <Link to ="/" class="nav-link" >Taxes</Link>
        </li>
        <li class="nav-item">
          <Link to ="/" class="nav-link" >Budgeting</Link>
        </li>
        <li class="nav-item">
          <Link to ="/" class="nav-link"  >Student Loans</Link>
        </li>
        <li class="nav-item">
          <Link to ="/" class="nav-link" >Insurance</Link>
        </li>
        <li class="nav-item">
          <Link to ="/" class="nav-link" >Investing</Link>
        </li>
      </ul>
    </div>
  </div>
</nav>
        // <div className='navbar nav-bar'>
        //     <ul className='nav-list'>
        //     <Link to ="/">  <li>Home</li></Link>
        //       <Link to ="/bank-accounts">  <li>Bank Accounts</li></Link>
        //     <Link  to ="/credit" > <li>Credit</li></Link>
        //     <Link to ="/budgeting" >  <li>Budgeting</li></Link>
        //     <Link to="/insurance" > <li>Insurance</li></Link>
        //     <Link to ="/Taxes" >  <li>Taxes</li></Link>
        //     <Link to ="/student-loans" > <li>Student Loans</li></Link>
        //     <Link to ="/investing" > <li>Investing</li></Link>


        //     </ul>

        // </div>
    )

}
export default Navbar;
